aSessionNumberS	db 'SESSION <number> [<string>]',0Ah ; DATA XREF: .data:00452EA8o
		db 0Ah
		db 'The NUMBER is an arbitrary value, a server may use to associate',0Ah
		db 'simultaneous running sessions.  It is a 32 bit unsigned integer',0Ah
		db 'with 0 as a special value indicating that no session association',0Ah
		db 'shall be done.',0Ah
		db 0Ah
		db 'If STRING is given, the server may use this as the title of a',0Ah
		db 'window or, in the case of an email operation, to extract the',0Ah
		db 'sender',27h,'s address. The string may contain spaces; thus no',0Ah
		db 'plus-escaping is used.',0Ah
		db 0Ah
		db 'This command may be used at any time and overrides the effect of',0Ah
		db 'the last command.  A RESET command undoes the effect of this',0Ah
		db 'command.',0
		align 20h
aRecipientRecip	db 'RECIPIENT <recipient>',0Ah ; DATA XREF: .data:00452EB4o
		db 0Ah
		db 'Set the recipient for the encryption.  <recipient> is an RFC2822',0Ah
		db 'recipient name.  This command may or may not check the recipient '
		db 'for',0Ah
		db 'validity right away; if it does not (as here) all recipients are',0Ah
		db 'checked at the time of the ENCRYPT command.  All RECIPIENT comman'
		db 'ds',0Ah
		db 'are cumulative until a RESET or an successful ENCRYPT command.',0
		align 20h
