aVerifyProtocol	db 'VERIFY --protocol=OpenPGP|CMS [--silent]',0Ah
					; DATA XREF: .data:00452F20o
		db 0Ah
		db 'Verify a message.  Depending on the combination of the',0Ah
		db 'sources/sinks set by the commands MESSAGE, INPUT and OUTPUT, the',0Ah
		db 'verification mode is selected like this:',0Ah
		db 0Ah
		db 'MESSAGE and INPUT',0Ah
		db '  This indicates a detached signature.  Output data is not applic'
		db 'able.',0Ah
		db 0Ah
		db 'INPUT ',0Ah
		db '  This indicates an opaque signature.  As no output command has',0Ah
		db '  been given, we are only required to check the signature.',0Ah
		db 0Ah
		db 'INPUT and OUTPUT',0Ah
		db '  This indicates an opaque signature.  We write the signed data t'
		db 'o',0Ah
		db '  the file descriptor set by the OUTPUT command.  This data is ev'
		db 'en',0Ah
		db '  written if the signature can',27h,'t be verified.',0Ah
		db 0Ah
		db 'With the option --silent we won',27h,'t display any dialog; this is '
		db 'for',0Ah
		db 'example used by the client to get the content of an opaque signed'
		db 0Ah
		db 'message.  This status message is always send before an OK respons'
		db 'e:',0Ah
		db 0Ah
		db '   SIGSTATUS <flag> <displaystring>',0Ah
		db 0Ah
		db 'Defined FLAGS are:',0Ah
		db 0Ah
		db '   none',0Ah
		db '     The message has a signature but it could not not be verified'
		db 0Ah
		db '     due to a missing key.',0Ah
		db 0Ah
		db '   green',0Ah
		db '     The signature is fully valid.',0Ah
		db 0Ah
		db '   yellow',0Ah
		db '     The signature is valid but additional information was shown',0Ah
		db '     regarding the validity of the key.',0Ah
		db 0Ah
		db '   red',0Ah
		db '     The signature is not valid. ',0Ah
		db 0Ah
		db 'The DISPLAYSTRING is a percent-and-plus-encoded string with a sho'
		db 'rt',0Ah
		db 'human readable description of the status.',0
